T = readtable('Data_August_Renewable.csv');

% Create a lifting scheme using the 'haar' wavelet
lScheme = liftingScheme('Wavelet', 'haar');

% [ca cd] = dwt(speedData, 'haar')

% Perform the lifting wavelet transform at level 2
speedData = table2array(T(:, "Speed")); % Convert the "Speed" column to a list of doubles
disp(speedData) %[output:041c0e5d]
% [ca, cd] = lwt(speedData, 'LiftingScheme', lScheme, 'Level', 1);
[ca, cd] = lwt(speedData, 'Wavelet', 'haar', 'Level', 4);

% Display approximation and detail coefficients
disp('Approximation Coefficients:'); %[output:269bff28]
disp(ca); %[output:2610c269]

disp('Detail Coefficients:'); %[output:50a0f92a]
disp(cd{1}); %[output:38b663df]

% Save approximation coefficients to a CSV file
writetable(array2table(ca), 'approximation_coefficients_matlab_l4.csv');
% 



% Reconstruct the signal from wavelet coefficients
x_rec = ilwt(ca, cd, 'LiftingScheme', lScheme);

% Plot original and reconstructed signals
figure; %[output:6ef018b8]
subplot(2,1,1); %[output:6ef018b8]
plot(speedData, 'b-o', 'LineWidth', 1.5); %[output:6ef018b8]
title('Original Signal'); %[output:6ef018b8]
xlabel('Sample Index'); ylabel('Amplitude'); %[output:6ef018b8]

subplot(2,1,2); %[output:6ef018b8]
plot(x_rec, 'r-o', 'LineWidth', 1.5); %[output:6ef018b8]
title('Reconstructed Signal from LWT'); %[output:6ef018b8]
xlabel('Sample Index'); ylabel('Amplitude'); %[output:6ef018b8]

% Optional: Compare error
disp('Reconstruction Error:'); %[output:38464c5e]
disp(norm(speedData - x_rec)); %[output:4ef1bf02]

